  Future<String> fetchToken(String username, String password) async {
    final String auth =
        'Basic ' + base64Encode(utf8.encode('$username:$password'));

    final Uri apiUrl = Uri.parse('https://login.meteomatics.com/api/v1/token');

    try {
      final http.Response response = await http.get(
        apiUrl,
        headers: {'Authorization': auth},
      );

      if (response.statusCode == 200) {
        final Map<String, dynamic> data = json.decode(response.body);
        final String token = data['access_token'];
        return token;
      } else {
        print('Error: ${response.statusCode}');
        print('Something went wrong');
        throw Exception(
            'Falla al obtener el token'); // or throw an exception if you prefer
      }
    } catch (error) {
      print('Exception: $error');
      print('Something went wrong');
      throw Exception(
          'Falla al obtener el token'); // or throw an exception if you prefer
    }
  }

  Future<Map<String, dynamic>> fetchJSON(String token, List<double> coordinates) async {
    // obtener hora actual en utc - 0
    DateTime currentUtc0DateTime = obtenerFechaHoraActualUtc0();

    String formattedTime = currentUtc0DateTime.toUtc().toIso8601String();

    String apiURL =
        'https://api.meteomatics.com/$formattedTime/t_2m:C,weather_symbol_1h:idx/${coordinates[0]},${coordinates[1]}/json?access_token=$token';
    print(apiURL);
    final response = await http.get(Uri.parse(apiURL));
    if (response.statusCode == 200) {
      return jsonDecode(response.body);
    } else {
      throw Exception('Failed to load JSON data');
    }
  }

  DateTime obtenerFechaHoraActualUtc0(){
    DateTime currentLocalDateTime = DateTime.now();

    DateTime currentUtc0DateTime = DateTime.utc(
      currentLocalDateTime.year,
      currentLocalDateTime.month,
      currentLocalDateTime.day,
      currentLocalDateTime.hour,
      currentLocalDateTime.minute,
      currentLocalDateTime.second,
    );

    return currentUtc0DateTime;
  }

